import { createRouter, createWebHistory } from 'vue-router'
// import VueRouter from "vue-router";
// import Vue from "vue";
import homePage from '../components/homePage.vue';
import blogPage from '../components/blogPage.vue';
import catagoryPage from '../components/catagoryPage.vue';
import tagPage from '../components/tagPage.vue';
import aboutme from '../components/aboutMePage.vue'
import blogManPage from '../components/blogManPage.vue'
import blogPublishPage from '../components/blogPublishPage.vue'

// Vue.use(VueRouter);

const routes = [
  {
    path: '/blogPublishPage',
    component: blogPublishPage
  },
  {
    path: '/blogManPage',
    component: blogManPage
  },
  {
    path: '/aboutMe',
    component: aboutme
  },
  {
    path: '/tagPage',
    component: tagPage
  },
  {
    path: '/catagoryPage',
    component: catagoryPage
  },
  {
    path: '/homePage',
    component: homePage
  },
  {
    path: '/homePage/blogPage',
    component: blogPage
  },
  // 重定向
  {
    path: '/', 
    redirect: '/homePage'
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router;
